import React, { useState } from "react";
import "./notes-collected.css";

const NotesCollected = () => {
  [noteCount, setNoteCount] = useState(0);
  return (
    <div className="notes-test">
      <h1>{noteCount}/3</h1>
    </div>
  );
};

export default NotesCollected;
